import React from 'react';
import "../hojas-de-estilo/Articulos.css";

let items = [];

function Articulos(){
  return(
    <div className='con_articulos'>
      <div className='con_articulos_titulo'>
        <span>Cart</span>
      </div>
      <div className='con_articulos_lista'>
        {items.length===0?<span>Your cart is empty.</span>:null}
        <div className='empty'>
        <ul className='list'>
          {items.map((item) =>(
            <li key={item}>{item}</li>
          ))}
        </ul>
        </div>
      </div>
    </div>
  );
}

export default Articulos;
